import { Route } from "react-router-dom";
// import AllMeetUps from "./pages/AllMeetUps";
import Favourites from "./pages/Favourites";
import NewMeetUp from "./pages/NewMeetUp";

function App() {
  return (
    <div>
      <Route path="/new-meetups">
        <NewMeetUp />
      </Route>
      <Route path="/favourites">
        <Favourites />
      </Route>
    </div>
  );
}

export default App;
